varDefOn('taskDecision', true, function() {
    var taskDecision = _.find(self.state.items, 'tvar_name', 'taskDecision');
    var allowedValues = [
        'Ready for employee takeover',
        'Ready to be taken over by the supervisor'
    ];
    return Object.assign(taskDecision, {
        ivar_lov: _.filter(taskDecision.ivar_lov, function(item) {
            return allowedValues.includes(item.value);
        })
    });
});

