changeVarVal(['employeeType', 'equipmentAccessOffice', 'equipmentAccessWarehouse', 'equipmentCar', 'equipmentLaptop', 'equipmentPhone', 'equipmentClothes'], true, function() {
    var position = vSync('positionTitle');
    if (position == 'Skladník') {
        return [{
            "value": 'Blue collar',
            "title": "Manuální"
        }, 0, 1, 0, 0, 0, 1];
    } else if (position) {
        return [{
            "value": 'White collar',
            "title": "Nemanuální"
        }, 1, 0, 1, 1, 1, 0];
    } else {
        return [vSync('employeeType'), vSync('equipmentAccessOffice'), vSync('equipmentAccessWarehouse'), vSync('equipmentCar'), vSync('equipmentLaptop')];
    }
});

/* Příklad doplnění jména uživatele podle userId z DT */
changeVarVal("manager", fnIsNotEmpty(v('department')), function() {
    var department = vSync('department');
    console.log(department)
    if (department) {
        return Api.request.get('/org-units/' + department).then(function(org) {
            console.log(org)
            return org.manager_user_id
        }).catch(function(error) {
            return v('manager')
        })
    }
    return v('manager')
});

hideVarOn('positionRequirements', function() {
    return vSync('equipmentLaptop') == false;
});

